import React, { useState } from 'react';
import { Minus, Plus } from 'lucide-react';

const HealthScoreCalculator = () => {
  const [inputs, setInputs] = useState([
    {
      id: 1, 
      name: '', 
      weight: 20,
      values: [{ id: 1, name: '', points: 0 }]
    }
  ]);

  // Add a new input
  const addInput = () => {
    const newInput = {
      id: inputs.length + 1,
      name: '',
      weight: 20,
      values: [{ id: 1, name: '', points: 0 }]
    };
    setInputs([...inputs, newInput]);
  };

  // Update input name
  const updateInputName = (inputId, newName) => {
    setInputs(inputs.map(input => 
      input.id === inputId ? { ...input, name: newName } : input
    ));
  };

  // Adjust input weight (in 5% steps)
  const adjustInputWeight = (inputId, adjustment) => {
    setInputs(inputs.map(input => {
      if (input.id === inputId) {
        const newWeight = Math.max(0, Math.min(100, input.weight + adjustment));
        return { ...input, weight: newWeight };
      }
      return input;
    }));
  };

  // Add a new value to an input
  const addValue = (inputId) => {
    setInputs(inputs.map(input => {
      if (input.id === inputId) {
        const newValue = {
          id: input.values.length + 1,
          name: '',
          points: 0
        };
        return { ...input, values: [...input.values, newValue] };
      }
      return input;
    }));
  };

  // Update value name
  const updateValueName = (inputId, valueId, newName) => {
    setInputs(inputs.map(input => {
      if (input.id === inputId) {
        return {
          ...input,
          values: input.values.map(value => 
            value.id === valueId ? { ...value, name: newName } : value
          )
        };
      }
      return input;
    }));
  };

  // Adjust value points
  const adjustValuePoints = (inputId, valueId, adjustment) => {
    setInputs(inputs.map(input => {
      if (input.id === inputId) {
        return {
          ...input,
          values: input.values.map(value => 
            value.id === valueId 
              ? { ...value, points: Math.max(0, value.points + adjustment) } 
              : value
          )
        };
      }
      return input;
    }));
  };

  // Calculate total weight to ensure it doesn't exceed 100%
  const totalWeight = inputs.reduce((sum, input) => sum + input.weight, 0);

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-6">Customer Success Health Score Calculator</h1>

      {inputs.map((input) => (
        <div key={input.id} className="border rounded-lg p-4 mb-4 bg-white shadow-sm">
          <div className="flex items-center mb-4">
            <input 
              type="text" 
              placeholder="Input Name" 
              value={input.name}
              onChange={(e) => updateInputName(input.id, e.target.value)}
              className="flex-grow mr-4 p-2 border rounded"
            />

            <div className="flex items-center">
              <span className="mr-2">Weight:</span>
              <button 
                onClick={() => adjustInputWeight(input.id, -5)}
                className="p-1 bg-gray-200 rounded-l"
              >
                <Minus size={16} />
              </button>
              <input 
                type="text" 
                value={`${input.weight}%`}
                readOnly 
                className="w-16 text-center border-t border-b p-1"
              />
              <button 
                onClick={() => adjustInputWeight(input.id, 5)}
                className="p-1 bg-gray-200 rounded-r"
              >
                <Plus size={16} />
              </button>
            </div>
          </div>

          {/* Values for each Input */}
          <div className="pl-4">
            {input.values.map((value) => (
              <div key={value.id} className="flex items-center mb-2">
                <input 
                  type="text" 
                  placeholder="Value Name" 
                  value={value.name}
                  onChange={(e) => updateValueName(input.id, value.id, e.target.value)}
                  className="flex-grow mr-4 p-2 border rounded"
                />

                <div className="flex items-center">
                  <button 
                    onClick={() => adjustValuePoints(input.id, value.id, -1)}
                    className="p-1 bg-gray-200 rounded-l"
                  >
                    <Minus size={16} />
                  </button>
                  <input 
                    type="text" 
                    value={value.points}
                    readOnly 
                    className="w-16 text-center border-t border-b p-1"
                  />
                  <button 
                    onClick={() => adjustValuePoints(input.id, value.id, 1)}
                    className="p-1 bg-gray-200 rounded-r"
                  >
                    <Plus size={16} />
                  </button>
                </div>
              </div>
            ))}

            <button 
              onClick={() => addValue(input.id)}
              className="mt-2 p-2 bg-blue-500 text-white rounded hover:bg-blue-600"
            >
              Add Value
            </button>
          </div>
        </div>
      ))}

      <div className="flex justify-between items-center mt-4">
        <button 
          onClick={addInput}
          className="p-2 bg-green-500 text-white rounded hover:bg-green-600"
        >
          Add Input
        </button>

        <div className="text-right">
          <p>Total Weight: {totalWeight}%</p>
          {totalWeight > 100 && (
            <p className="text-red-500">Warning: Total weight exceeds 100%</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default HealthScoreCalculator;
